(5, 'Laptop Gaming IdeaPad Gaming 3 15ARH7 cu procesor AMD Ryzen 5 6600H pana la 4.50 GHz, 15.6\" Full HD, IPS, 120Hz, 16GB DDR5, 512GB SSD, NVIDIA GeForce RTX 3050 4GB GDDR6, No OS, Onyx Grey', 1, 8, 6337, 'Laptop Gaming Lenovo IdeaPad 3 15ARH7 cu procesor AMD Ryzen 7 7735HS pana la 4.75 GHz, 15.6\" Full HD, IPS, 120Hz, 16GB, 512GB SSD, NVIDIA GeForce RTX 3050 6GB GDDR6, No OS, Onyx Grey \r\n \r\n\r\nViteza intalneste rezistenta cu procesoarele AMD Ryzen.\r\n\r\nViteza se intalneste cu rezistenta atunci cand va jucati cu un laptop de jocuri echipat cu procesoare AMD Ryzen. Profitati de performanta pura de care aveti nevoie pentru a castiga, fara a compromite durata de viata a bateriei.\r\n\r\n\r\nGPU-urile din seria GeForce RTX ofera performante maxime pentru jucatori si creatori. Acestea sunt alimentate de Ampere - arhitectura RTX de a doua generatie de la NVIDIA - cu noi RT Cores, Tensor Cores si multiprocesoare de streaming pentru cele mai realiste grafice ray-traced si caracteristici AI de ultima generatie.\r\n \r\nRacire Quad Vent\r\n\r\nRacirea rapida si silentioasa Quad Vent din laptopul IdeaPad Gaming 3 Gen 7 inseamna ca va veti bucura de imbunatatiri ale racirii care va vor permite sa va jucati la cele mai inalte setari de performanta. Caracteristici precum admisia de aer de la tastatura, ratele de ventilatie mai mari, imbunatatite cu 20%, si un flux de aer al ventilatoarelor cu 10% mai mare fata de generatia precedenta, fac ca jocurile sa fie dintre cele mai reci pe unul dintre cele mai reci aparate Lenovo.\r\n 	 \r\nDesign nou, elegant si aerodinamic\r\n\r\nModelele Onyx Grey si Glacier White sunt expresive, dar simple, cu logo-uri minime si accente subtile de albastru care arata ca sunteti aici pentru jocuri, dar cu stil. Porturile I/O din spate va pastreaza cablurile ordonate si curate. In plus, tastatura de gaming semnata de Lenovo vine cu comenzi media si un pad numeric. In plus, bucurati-va de o discretie sporita cu ajutorul comutatorului de inchidere a confidentialitatii camerei web.\r\n', 'No OS', '8giemt5e255q8c3ddrh0o4dkrm', 1, '2023-11-25', 'Ryzen 7', 16, 'NVIDIA GeForce RTX 3050 6GB GDDR6'),
(8, 'Laptop Apple MacBook Pro 16\" cu procesor Apple M2 Pro, 12 nuclee CPU and 19 nuclee GPU, 16 GB, 1TB SSD, Space Grey, INT KB', 1, 8, 14280, 'Laptop Apple MacBook Pro 16\" cu procesor Apple M2 Pro, 12 nuclee CPU and 19 nuclee GPU, 16 GB, 1TB SSD, Space Grey, INT KB \r\n\r\nGenul care se ambitioneaza. Creeaza. Revolutioneaza.\r\nCu superputerea M2 Pro sau M2 Max, MacBook Pro duce puterea si eficienta mai departe ca niciodata. Ofera o performanta exceptionala, fie ca e conectat sau nu la alimentare. Si continua sa functioneze si mai mult pe baterie. La pachet cu un fantastic\r\necran Liquid Retina XDR si toate porturile de care ai nevoie, cu siguranta este laptopul profesional pe care l-ai asteptat.\r\n\r\nUltima generatie de cipuri Apple pentru profesionisti incepe cu fulgerator de rapidul M2 Pro si extraordinarul M2 Max ï¿½ un cip puternic si eficient care ofera o performanta exceptionala.\r\n\r\n \r\nM2 Pro\r\nM2 Pro livreaza puterea necesara ca tu sa poti prelua proiecte si mai solicitante. Cu un CPU cu pana la 12 nuclee si Neural Engine de ultima generatie, fluxurile profesionale de lucru pur si simplu zboara: de la sortarea si editarea a mii de imagini, pana la rularea simularilor de dinamica computerizata a fluidelor. Iar un GPU cu pana la 19 nuclee ofera o crestere uriasa a performantei grafice atat pentru lucru, cat si pentru joc.\r\n\r\n \r\n\r\nM2 Max\r\nUn cip puternic si eficient, M2 Max este conceput pentru a ajuta profesionistii sa-si depaseasca limitele ingeniozitatii si creativitatii. Din aceeasi generatie de CPU cu 12 nuclee ca si M2 Pro, M2 Max are o latime dubla de banda pentru memorie, de trei ori mai multa memorie unificata si GPU cu pana la 38 de nuclee. Astfel, poti randa efecte, poti imbina imagini panoramice masive si poti proiecta geometrie 3D extrema, la o scara fara precedent.\r\n\r\nMacBook Pro este disponibil in versiuni de 14 inchi si de 16 inchi. Fiecare poate fi configurat cu cipul M2 Pro sau M2 Max si ofera o performanta profesionala, de ultima generatie, intr-un singur laptop.\r\n\r\n \r\nBateria o tine asa toata ziua.\r\n\r\nAmbele modele raman la fel de rapide, fie ca sunt pe baterie sau conectate la alimentare. Toata aceasta eficienta este magia cipului Apple. Asa ca, oricand te loveste inspiratia sau trebuie sa fii la datorie, esti gata.\r\n\r\n \r\nGandeste la scara grandioasa. MacBook Pro este construit pe o arhitectura de stocare integral flash, conceputa ca sa ai parte de viteza si receptivitate in sarcinile de zi cu zi. Pentru fluxuri de lucru solicitante, cu fisiere mari, configuratiile de pana la 8 TB ofera si mai multa performanta.\r\n\r\n\r\nCe e mai cool, acum urmeaza. Datorita eficientei cipului Apple, ventilatoarele nici nu trebuie sa porneasca pentru majoritatea activitatilor tale zilnice. Iar pentru fluxuri de lucru mai complicate, sistemele termice avansate deplaseaza aerul la viteze reduse ale ventilatorului.	\r\n\r\n Un sistem de operare super operativ.\r\nmacOS Ventura a fost conceput sa maximizeze capabilitatile cipului Apple. Pentru ca principalele tale aplicatii profesionale sa ruleze mai rapid, iar multitasking-ul sa se desfasoare mai cursiv ca oricand. Cu peste 15.000 de aplicatii si plug-in-uri optimizate, precum si functii noi si puternice ale macOS cum ar fi Stage Manager, poti lucra mai inteligent, te poti juca mai intens si poti face mai multe ca oricand.\r\n\r\n \r\nUn ecran de laptop care depaseste orice asteptari.\r\n\r\n Liquid Retina XDR. Gama dinamica extrema ofera reflexii speculare rafinate, detalii incredibile in umbre si culori intense si realiste. Fiecare ecran vine calibrat din fabrica si ofera moduri de referinta profesionale pentru gradarea culorilor in HDR, fotografie, design si imprimare.\r\n\r\n ProMotion. Orice actiune ï¿½ de la derularea unei pagini web, la jocuri ï¿½ devine foarte cursiva si receptiva. ProMotion efectueaza ajustari automate in functie de miscarea continutului, cu o rata de improspatare de pana la 120 Hz. Editorii video pot, de asemenea, sa aleaga o rata de improspatare fixa pentru alinierea perfecta a materialului editat.\r\n\r\n \r\nMini-LED-uri. Mii de mini-LED-uri sunt grupate in zone diferentiate de luminozitate controlate individual, pentru luminozitate si contrast precise.\r\n\r\nCarcasa ecranului. Cu mai putin de 4 mm grosime, ofera structura pentru cel mai bun monitor de laptop din lume.\r\n\r\nPelicule si dispersoare de lumina personalizate. Sapte pelicule si dispersoare de lumina mixeaza si modeleaza eficient lumina, facand in acelasi timp posibil un design ultra subtire.\r\n\r\nEcran LCD. Contine o pelicula subtire de oxid (TFT), de mare mobilitate, care permite incarcarea de 2x mai rapida a pixelilor, facand posibile rate de improspatare de pana la 120 Hz.\r\n\r\n \r\nDe departe, cel mai tare look al tau\r\n\r\nArati clar si bine oriunde efectuezi sau preiei apeluri ï¿½ fie cand iei legatura cu prietenii si familia de pe alte fusuri orare, fie cand colaborezi cu colegii de pe teren. Camera de 1080p foloseste un obiectiv cu diafragma larga pentru a capta mai multa lumina. Impreuna cu senzorul de imagine mai mare, camera asigura o performanta mai buna in medii slab iluminate.\r\n\r\nTrei microfoane la calitate de studio\r\n\r\nDatorita raportului semnal-zgomot care rivalizeaza cu microfoanele profesionale, MacBook Pro poate capta chiar si cele mai subtile sunete. Iar tehnologia directionala beamforming reduce zgomotul de fond pentru ca vocea ta sa se auda tare si clar.\r\n\r\n	 \r\nSistem audio cu sase difuzoare\r\n\r\nCele patru woofere anti-distorsiuni redau note mai joase si un sunet care umple incaperea. Tweeterele de inalta performanta redau voci mai clare si mai pline. Iar tehnologia Audio spatial creeaza un sunet tridimensional sofisticat, la redarea de muzica sau videoclipuri cu Dolby Atmos.\r\n\r\nS-a conectat, s-a si activat.\r\n\r\nTransfera fotografii si videoclipuri cu cititorul de carduri SDXC. Conecteaza-te la televizoare si ecrane prin iesirea HDMI, care accepta acum pana la 8K. Conecteaza-te la accesorii si ecrane suplimentare folosind cele trei porturi Thunderbolt 4. Si bucura-te de o viteza de doua ori mai rapida cu Wi-Fi 6E.\r\n\r\nExtinde-ti suprafata ecranului si perspectivele. Conecteaza pana la trei ecrane Pro Display XDR si un televizor 4K, cu M2 Max. Sau pana la doua ecrane Pro Display XDR cu M2 Pro.\r\n\r\nMagic Keyboard are un rand de taste-functii la inaltime completa si Touch ID care ofera o modalitate rapida, simpla si sigura de a-ti debloca Mac-ul si a te conecta la aplicatii si site-uri.\r\n\r\n ', 'Mac OS', '8giemt5e255q8c3ddrh0o4dkrm', 1, '2023-11-25', 'Apple M2 Pro', 16, 'Integrata, 19 GPU'),
(4, 'Laptop Apple MacBook Air 13-inch, True Tone, procesor Apple M1 , 8 nuclee CPU si 7 nuclee GPU, 8GB, 256GB, Space Grey, INT KB', 1, 8, 4650, 'Laptop Apple MacBook Air 13-inch, True Tone, procesor Apple M1 , 8 nuclee CPU si 7 nuclee GPU, 8GB, 256GB, Space Grey, INT KB\r\n\r\nCel mai subtire si mai usor notebook-ul nostru, complet transformat de cipul Apple M1. Viteza procesorului de pana la de 3,5 ori mai rapida. Viteza GPU-ului de pana la 5 ori mai rapida. Cel mai avansat motor neuronal pentru invatare automata de pana la de 9 ori mai rapida. Cea mai mare autonomie a bateriei vreodata pe un MacBook Air. Si un design silentios, fanless. Atata putere nu a fost niciodata atat de pregatita.\r\n\r\nCip mic. Salt urias.\r\nE aici. Primul nostru cip conceput special pentru Mac. Echipat cu 16 miliarde de tranzistori, sistemul pe un cip (SoC - System on a Chip) Apple M1 integreaza CPU, GPU, motor neuronal, I/O si multe altele pe un singur cip minuscul. Cu performante incredibile, tehnologii personalizate si eficienta energetica de varf, M1 nu este doar un pas urmator pentru Mac - este cu totul un alt nivel.\r\n\r\nCPU cu 8 nuclee care devoreaza task-urile\r\nM1 are cel mai rapid procesor pe care l-am realizat vreodata. Cu acest tip de viteza de procesare, MacBook Air poate prelua sarcini noi extrem de solicitante, cum ar fi editarea profesionala si jocurile pline de actiune. Insa procesorul cu 8 nuclee de pe M1 nu este doar  cu de pana la 3,5 ori mai rapid decat generatia anterioara - echilibreaza nucleele de inalta performanta cu nucleele de eficienta care oricum pot rezolva sarcinile zilnice in timp ce utilizeaza doar o zecime din putere.\r\n\r\nCu pana la de 9 ori mai rapid. Chiar si pentru un motor neuronal cu 16 nuclee, este mult de procesat. Aplicatiile de pe MacBook Air pot utiliza invatarea automata (ML - machine learning) pentru a retusa automat fotografii ca un profesionist, pentru a utiliza instrumentele inteligente precum baghetele magice, filtre audio mai precise la detectarea automata si multe altele. Aceasta nu este doar puterea creierului - aceasta este puterea unei stive complete de tehnologii ML.	\r\n \r\nPuterea macOS Big Sur pe M1.\r\nDezvoltat pentru a elibera potentialul cipului M1, macOS Big Sur transforma Mac cu beneficii majore de performanta si multe altele. Actualizari puternice pentru aplicatii. Un design nou atragator. Functii de confidentialitate de top si cea mai buna securitate. Este cel mai puternic software al nostru - ruleaza pe cel mai avansat hardware de pana acum.\r\n\r\nViteza si receptivitate\r\nCipul M1 si macOS Big Sur functioneaza impreuna pentru a face intregul sistem mai rapid. MacBook Air porneste instantaneu din modul Sleep. Sarcinile zilnice, de la rasfoirea fotografiilor la navigarea in Safari, sunt mai rapide. Si aplicatiile dvs. cele mai solicitante au toate acces la puterea de care au nevoie.\r\n\r\nCea mai mare colectie de aplicatii\r\nRulati aplicatii puternice construite pentru M1. Toate aplicatiile existente functioneaza datorita Rosetta 2. Si pentru prima data, puteti utiliza aplicatiile dvs. preferate pentru iPhone si iPad direct pe macOS Big Sur. In total, veti avea acces la cea mai mare colectie de aplicatii realizate vreodata pentru Mac.\r\n\r\n\r\n 	 	 \r\nCipul M1 aduce pana la 16GB de memorie super rapida. Aceasta memorie cu latime de banda mare, cu latenta redusa permite aplicatiilor sa partajeze date eficient intre CPU, GPU si motorul neuronal - astfel incat tot ceea ce faceti este rapid si fluid.\r\n 	 	 \r\nDisplay Retina - Culori realiste pentru o frumusete ireala.\r\nImaginile capata un nivel complet nou de precizie si realism pe display-ul Retina de 13,3\", 2560 x 1600. Textul este clar. Culorile sunt mai vibrante ca niciodata. Si ecranul se intinde si mai mult, asa ca tu te poti concentra mai bine la ce se intampla pe ecran. \r\n 	 	 \r\nTehnologia True Tone\r\nAratos. Si usor de privit. MacBook Air ajusteaza automat punctul alb al afisajului la temperatura culorii mediului dvs. pentru o experienta de vizionare mai naturala.\r\n 	 \r\nCamera si microfoane\r\nProcesorul de semnal de imagine din cipul M1 va ajuta sa aratati cel mai bine pentru fiecare apel FaceTime si conferinta video. Trei microfoane incorporate va asigura ca ceea ce spuneti este auzit indiferent daca sunteti in apel, dictati o notita sau o intrebati pe Siri despre vreme.\r\n\r\n \r\nCamera FaceTime HD\r\nObtineti imagini mai clare si mai precise. Vedeti mai multe detalii in umbre si trasaturi. Iar detectarea fetei foloseste motorul neuronal pentru a regla balansul de alb si expunerea pentru tonuri ale pielii mai naturale.\r\n\r\nTastatura Magic\r\nCand o tastatura functioneaza perfect si inca face mult mai mult: asta este magie. Cu noile comenzi rapide preprogramate, functiile utile sunt si mai usor de accesat. Obtineti ajutor de la Siri, schimbati limba de la tastatura, raspundeti cu emoji-urile perfecte, gasiti documente cu Spotlight - puteti face atat de multe cu o simpla atingere. Iar tastele iluminate cu senzor de lumina ambientala va ajuta sa tastati in conditii de lumina slaba.\r\n\r\n \r\nMecanismul foarfeca reproiectat ofera cea mai buna experienta de tastare vreodata pe un notebook Mac.	\r\n \r\nTouch ID\r\nO singura atingere este tot ce trebuie pentru a bloca sau debloca MacBook Air. Folositi amprenta dvs. pentru a inchiria un film, pentru a cumpara o aplicatie sau pentru a accesa lucruri precum documente securizate sau setari de sistem, fara a fi nevoie sa reintroduceti parola. \r\n\r\n \r\nWi-Fi 6\r\nUrmatoarea generatie de Wi-Fi nu este doar mai rapida - mentine MacBook Air in functiune, chiar daca tot mai multe dispozitive se alatura retelei.\r\n\r\nThunderbolt / USB 4\r\nLatimea de banda ultra-ridicata intalneste ultra-versatilitatea. Thunderbolt permite transferul de date, incarcare si iesirea video printr-un singur port - iar MacBook Air are doua.\r\n\r\n ', 'Mac OS', '8giemt5e255q8c3ddrh0o4dkrm', 1, '2023-11-25', 'Apple M1', 8, 'Integrata'),
