(5, 1, 0, , 'Laptop Gaming IdeaPad Gaming 3 15ARH7 cu procesor AMD Ryzen 5 6600H pana la 4.50 GHz, 15.6\" Full HD, IPS, 120Hz, 16GB DDR5, 512GB SSD, NVIDIA GeForce RTX 3050 4GB GDDR6, No OS, Onyx Grey', 6337, 15, '', 'Laptop Gaming Lenovo IdeaPad 3 15ARH7 cu procesor AMD Ryzen 7 7735HS pana la 4.75 GHz, 15.6\" Full HD, IPS, 120Hz, 16GB, 512GB SSD, NVIDIA GeForce RTX 3050 6GB GDDR6, No OS, Onyx Grey \r\n \r\n\r\nViteza intalneste rezistenta cu procesoarele AMD Ryzen.\r\n\r\nViteza se intalneste cu rezistenta atunci cand va jucati cu un laptop de jocuri echipat cu procesoare AMD Ryzen. Profitati de performanta pura de care aveti nevoie pentru a castiga, fara a compromite durata de viata a bateriei.\r\n\r\n\r\nGPU-urile din seria GeForce RTX ofera performante maxime pentru jucatori si creatori. Acestea sunt alimentate de Ampere - arhitectura RTX de a doua generatie de la NVIDIA - cu noi RT Cores, Tensor Cores si multiprocesoare de streaming pentru cele mai realiste grafice ray-traced si caracteristici AI de ultima generatie.\r\n \r\nRacire Quad Vent\r\n\r\nRacirea rapida si silentioasa Quad Vent din laptopul IdeaPad Gaming 3 Gen 7 inseamna ca va veti bucura de imbunatatiri ale racirii care va vor permite sa va jucati la cele mai inalte setari de performanta. Caracteristici precum admisia de aer de la tastatura, ratele de ventilatie mai mari, imbunatatite cu 20%, si un flux de aer al ventilatoarelor cu 10% mai mare fata de generatia precedenta, fac ca jocurile sa fie dintre cele mai reci pe unul dintre cele mai reci aparate Lenovo.\r\n 	 \r\nDesign nou, elegant si aerodinamic\r\n\r\nModelele Onyx Grey si Glacier White sunt expresive, dar simple, cu logo-uri minime si accente subtile de albastru care arata ca sunteti aici pentru jocuri, dar cu stil. Porturile I/O din spate va pastreaza cablurile ordonate si curate. In plus, tastatura de gaming semnata de Lenovo vine cu comenzi media si un pad numeric. In plus, bucurati-va de o discretie sporita cu ajutorul comutatorului de inchidere a confidentialitatii camerei web.\r\n', 'No OS', 'Ryzen 7', 16, 'NVIDIA GeForce RTX 3050 6GB GDDR6');
