INSERT INTO `produse` (`id_produs`, `id_categorie`, `id_subcategorie`, `imagine`, `denumire`, `pu`, `cantitate`, `link`, `descriere`, `so`, `procesor`, `ram`, `video`) VALUES
(8, 1, 0, , 'Laptop Apple MacBook Pro 16\" cu procesor Apple M2 Pro, 12 nuclee CPU and 19 nuclee GPU, 16 GB, 1TB SSD, Space Grey, INT KB', 14280, 3, '', 'Laptop Apple MacBook Pro 16\" cu procesor Apple M2 Pro, 12 nuclee CPU and 19 nuclee GPU, 16 GB, 1TB SSD, Space Grey, INT KB \r\n\r\nGenul care se ambitioneaza. Creeaza. Revolutioneaza.\r\nCu superputerea M2 Pro sau M2 Max, MacBook Pro duce puterea si eficienta mai departe ca niciodata. Ofera o performanta exceptionala, fie ca e conectat sau nu la alimentare. Si continua sa functioneze si mai mult pe baterie. La pachet cu un fantastic\r\necran Liquid Retina XDR si toate porturile de care ai nevoie, cu siguranta este laptopul profesional pe care l-ai asteptat.\r\n\r\nUltima generatie de cipuri Apple pentru profesionisti incepe cu fulgerator de rapidul M2 Pro si extraordinarul M2 Max – un cip puternic si eficient care ofera o performanta exceptionala.\r\n\r\n \r\nM2 Pro\r\nM2 Pro livreaza puterea necesara ca tu sa poti prelua proiecte si mai solicitante. Cu un CPU cu pana la 12 nuclee si Neural Engine de ultima generatie, fluxurile profesionale de lucru pur si simplu zboara: de la sortarea si editarea a mii de imagini, pana la rularea simularilor de dinamica computerizata a fluidelor. Iar un GPU cu pana la 19 nuclee ofera o crestere uriasa a performantei grafice atat pentru lucru, cat si pentru joc.\r\n\r\n \r\n\r\nM2 Max\r\nUn cip puternic si eficient, M2 Max este conceput pentru a ajuta profesionistii sa-si depaseasca limitele ingeniozitatii si creativitatii. Din aceeasi generatie de CPU cu 12 nuclee ca si M2 Pro, M2 Max are o latime dubla de banda pentru memorie, de trei ori mai multa memorie unificata si GPU cu pana la 38 de nuclee. Astfel, poti randa efecte, poti imbina imagini panoramice masive si poti proiecta geometrie 3D extrema, la o scara fara precedent.\r\n\r\nMacBook Pro este disponibil in versiuni de 14 inchi si de 16 inchi. Fiecare poate fi configurat cu cipul M2 Pro sau M2 Max si ofera o performanta profesionala, de ultima generatie, intr-un singur laptop.\r\n\r\n \r\nBateria o tine asa toata ziua.\r\n\r\nAmbele modele raman la fel de rapide, fie ca sunt pe baterie sau conectate la alimentare. Toata aceasta eficienta este magia cipului Apple. Asa ca, oricand te loveste inspiratia sau trebuie sa fii la datorie, esti gata.\r\n\r\n \r\nGandeste la scara grandioasa. MacBook Pro este construit pe o arhitectura de stocare integral flash, conceputa ca sa ai parte de viteza si receptivitate in sarcinile de zi cu zi. Pentru fluxuri de lucru solicitante, cu fisiere mari, configuratiile de pana la 8 TB ofera si mai multa performanta.\r\n\r\n\r\nCe e mai cool, acum urmeaza. Datorita eficientei cipului Apple, ventilatoarele nici nu trebuie sa porneasca pentru majoritatea activitatilor tale zilnice. Iar pentru fluxuri de lucru mai complicate, sistemele termice avansate deplaseaza aerul la viteze reduse ale ventilatorului.	\r\n\r\n Un sistem de operare super operativ.\r\nmacOS Ventura a fost conceput sa maximizeze capabilitatile cipului Apple. Pentru ca principalele tale aplicatii profesionale sa ruleze mai rapid, iar multitasking-ul sa se desfasoare mai cursiv ca oricand. Cu peste 15.000 de aplicatii si plug-in-uri optimizate, precum si functii noi si puternice ale macOS cum ar fi Stage Manager, poti lucra mai inteligent, te poti juca mai intens si poti face mai multe ca oricand.\r\n\r\n \r\nUn ecran de laptop care depaseste orice asteptari.\r\n\r\n Liquid Retina XDR. Gama dinamica extrema ofera reflexii speculare rafinate, detalii incredibile in umbre si culori intense si realiste. Fiecare ecran vine calibrat din fabrica si ofera moduri de referinta profesionale pentru gradarea culorilor in HDR, fotografie, design si imprimare.\r\n\r\n ProMotion. Orice actiune – de la derularea unei pagini web, la jocuri – devine foarte cursiva si receptiva. ProMotion efectueaza ajustari automate in functie de miscarea continutului, cu o rata de improspatare de pana la 120 Hz. Editorii video pot, de asemenea, sa aleaga o rata de improspatare fixa pentru alinierea perfecta a materialului editat.\r\n\r\n \r\nMini-LED-uri. Mii de mini-LED-uri sunt grupate in zone diferentiate de luminozitate controlate individual, pentru luminozitate si contrast precise.\r\n\r\nCarcasa ecranului. Cu mai putin de 4 mm grosime, ofera structura pentru cel mai bun monitor de laptop din lume.\r\n\r\nPelicule si dispersoare de lumina personalizate. Sapte pelicule si dispersoare de lumina mixeaza si modeleaza eficient lumina, facand in acelasi timp posibil un design ultra subtire.\r\n\r\nEcran LCD. Contine o pelicula subtire de oxid (TFT), de mare mobilitate, care permite incarcarea de 2x mai rapida a pixelilor, facand posibile rate de improspatare de pana la 120 Hz.\r\n\r\n \r\nDe departe, cel mai tare look al tau\r\n\r\nArati clar si bine oriunde efectuezi sau preiei apeluri – fie cand iei legatura cu prietenii si familia de pe alte fusuri orare, fie cand colaborezi cu colegii de pe teren. Camera de 1080p foloseste un obiectiv cu diafragma larga pentru a capta mai multa lumina. Impreuna cu senzorul de imagine mai mare, camera asigura o performanta mai buna in medii slab iluminate.\r\n\r\nTrei microfoane la calitate de studio\r\n\r\nDatorita raportului semnal-zgomot care rivalizeaza cu microfoanele profesionale, MacBook Pro poate capta chiar si cele mai subtile sunete. Iar tehnologia directionala beamforming reduce zgomotul de fond pentru ca vocea ta sa se auda tare si clar.\r\n\r\n	 \r\nSistem audio cu sase difuzoare\r\n\r\nCele patru woofere anti-distorsiuni redau note mai joase si un sunet care umple incaperea. Tweeterele de inalta performanta redau voci mai clare si mai pline. Iar tehnologia Audio spatial creeaza un sunet tridimensional sofisticat, la redarea de muzica sau videoclipuri cu Dolby Atmos.\r\n\r\nS-a conectat, s-a si activat.\r\n\r\nTransfera fotografii si videoclipuri cu cititorul de carduri SDXC. Conecteaza-te la televizoare si ecrane prin iesirea HDMI, care accepta acum pana la 8K. Conecteaza-te la accesorii si ecrane suplimentare folosind cele trei porturi Thunderbolt 4. Si bucura-te de o viteza de doua ori mai rapida cu Wi-Fi 6E.\r\n\r\nExtinde-ti suprafata ecranului si perspectivele. Conecteaza pana la trei ecrane Pro Display XDR si un televizor 4K, cu M2 Max. Sau pana la doua ecrane Pro Display XDR cu M2 Pro.\r\n\r\nMagic Keyboard are un rand de taste-functii la inaltime completa si Touch ID care ofera o modalitate rapida, simpla si sigura de a-ti debloca Mac-ul si a te conecta la aplicatii si site-uri.\r\n\r\n ', 'Mac OS', 'Apple M2 Pro', 16, 'Integrata, 19 GPU');
