(10, 2, 1, , 'Sistem Desktop PC Gaming Serioux Powered by ASUS cu procesor Intel® Core™ i5-12400F pana la 4.4 GHz, 32GB DDR4, 1TB SSD M.2, ASUS Dual GeForce® RTX™ 4060 Ti OC 8GB GDDR6, No OS, Black\r\n', 5799, 5, '', 'Powered By ASUS\r\n\r\nSistemele Powered by ASUS sunt dedicate celor ce accepta doar perfectiunea. Echipele noastre de cercetare-dezvoltare de talie mondiala sunt complet devotate motto-ului companiei noastre – In Cautarea Incredibilului. Eforturile permanente de a atinge perfectiunea au fost recunoscute prin cele 3000+ de premii castigate anual. Din acest moment, sarcinile dificile sunt preluate de partenerii nostri din programul Powered by ASUS: integratori de sisteme atent selectionati ce creeaza sisteme de vis, unicat, de la ultra-compacte foarte performante la adevarati monstri raciti cu lichid.\r\n\r\n \r\nPlaca de baza ASUS                \r\n\r\nASUS este de mai bine de zece ani consecutivi principalul producator de placi de baza din lume, fiind complet dedicat inovatiei si performantelor. De asemenea, este producatorul cel mai premiat al celor mai bune placi, construite pe patru principii centrale – cele mai bine vandute, usor de folosit, stabile si de incredere. Cu peste 500 de milioane de placi de baza vandute in intreaga lume incepand cu 1989, ASUS este marca in care poti avea incredere.\r\n\r\n \r\nPlaca video ASUS\r\n\r\nASUS este producatorul #1 de placi video la nivel mondial, fiind singura companie ce ofera Tehnologia Auto-Extreme – un proces de productie automatizat in proportie de 100% pentru a oferi cea mai buna fiabilitate. Oferind numeroase tehnologii de racire exclusive, precum si aplicatii software cu un design foarte intuitiv, placile video ASUS fac posibile experiente de exceptie in jocuri, pentru mai multa adrenalina, mai multa distractie si mai multe victorii.\r\n\r\n \r\n\r\nIntel Core\r\n\r\nCalculatoarele desktop si dispozitivele mobile pot lucra mai mult, pot porni mai repede si pot sustine grafica la rezolutii mari datorita procesoarelor din seria Intel Core.\r\n\r\nIntel Core va ofera experiente impresionante in jocuri si aplicatii complexe. Va puteti juca si lucra fluent, intr-un mediu cu timpi de raspuns foarte mici.\r\n\r\n\r\nIntel Turbo Boost\r\n\r\nTurbo Boost Technology permite in mod automat nucleelor aflate pe procesor sa ruleze la o frecventa superioara, redirectionand puterea si accelerand performanta intr-o maniera proportionala sarcinilor si aplicatiilor la care sistemul este supus. Functioneaza pe sistemele care au la baza procesoarele Intel Core i5, i7 si i9.\r\n\r\n\r\n\r\nPosibilitati puternice\r\n\r\nMai putin timp de asteptare, mai multa activitate cu procesoare Intel® Core . Aceste procesoare va ofera mai multa performanta pentru productivitate crescuta.\r\n\r\n\r\nOptimizare automata cu GeForce Experience\r\nGeForce Experience este modalitatea perfecta de a va asigura ca sistemul dumneavoastra este mereu Game Ready. La fiecare joc nou lansat, veti avea automat driverele optimizate. Doar faceti clic si instalati. GeForce Experience analizeaza, de asemenea, sistemul dumneavoastra de joc si particularizeaza automat setarile – pentru cea mai buna experienta. Mai mult, puteti partaja cele mai bune momente din joc cu prietenii, utilizand noul overlay.\r\n\r\n \r\nGeForce RTX seria 40\r\n\r\nMAI MULT DECAT RAPIDE\r\n\r\nPlacile grafice NVIDIA® GeForce RTX™ seria 40 sunt mai mult decat rapide si sunt dedicate jucatorilor si creatorilor. Acestea au la baza arhitectura ultraeficienta NVIDIA Ada Lovelace, care ofera un salt imens atat in performanta, cat si in grafica bazata pe AI. Descopera lumi virtuale extrem de realiste, cu tehnologia ray-tracing, si gamingul la o frecventa de cadre ultrainalta, cu cea mai redusa latenta. Descopera noi modalitati revolutionare de a beneficia de o accelerare fara precedent in fluxurile de lucru.\r\n\r\nRay-tracing\r\n\r\nUltrarealist. Ultrarapid.\r\n\r\nArhitectura Ada descatuseaza intreaga putere a tehnologiei ray-tracing, care simuleaza comportamentul real al luminii. Cu puterea procesoarelor grafice RTX seria 40 si a nucleelor RT din a 3-a generatie, poti explora lumi virtuale incredibil de detaliate, asa cum nu ai mai facut-o niciodata.\r\n\r\n\r\n 	 \r\nNVIDIA DLSS 3\r\n\r\nInstrumentul de multiplicare a performantei, pe baza de AI.\r\n\r\nDLSS este o tehnologie revolutionara in grafica bazata pe AI, care sporeste performanta extrem de mult. Avand la baza noile nuclee Tensor din a 4-a generatie si Optical Flow Accelerator pentru placile grafice GeForce RTX seria 40, DLSS 3 utilizeaza AI-ul pentru a crea cadre suplimentare de inalta calitate.\r\n\r\n\r\n 	 \r\nNVIDIA Reflex\r\n\r\nVictorie masurata in milisecunde.\r\n\r\nNVIDIA Reflex si placile grafice GeForce RTX seria 40 ofera cea mai redusa latenta si cei mai buni timpi de raspuns, pentru avantajul competitiv suprem. Creat pentru a optimiza si masura latenta sistemului, Reflex iti permite sa tintesti mai repede, iti ofera timpi de reactie mai rapizi, precum si cea mai buna precizie atunci cand tintesti in jocurile competitive.\r\n\r\n\r\n 	 \r\nDrivere Game Ready\r\n\r\nDriverele GeForce Game Ready ofera cea mai buna experienta in jocurile tale preferate. Acestea sunt configurate cu precizie, in colaborare cu dezvoltatorii, si testate extensiv pe mii de configuratii de hardware, pentru a oferi maximul de performanta si fiabilitate.\r\n\r\n\r\n 	 \r\nGeForce Experience\r\n\r\nRealizeaza si partajeaza cu prietenii videoclipuri, capturi de ecran si livestreamuri. Mentine-ti driverele actualizate si optimizeaza-ti setarile jocului. GeForce Experience iti permite sa faci orice. Este partenerul esential al placii tale grafice GeForce.\r\n\r\n\r\n 	 \r\nNVIDIA G-SYNC\r\n\r\nBucura-te de un joc fluid, fara „ruperea” ecranului, la rate de reimprospatare inalte, plus HDR si multe altele. Acesta este cel mai bun afisaj pentru jocuri si este echipamentul recomandat pentru jucatorii entuziasti.\r\n\r\n\r\n 	 \r\nNVIDIA Ansel\r\n\r\nTransforma-ti capturile de ecran in arta cu aceasta functie foto puternica, integrata in joc, care face capturi 360, HDR si imagini cu o rezolutie excelenta.\r\n\r\n\r\n 	 \r\nRealitate virtuala\r\n\r\nGrafica cu cea mai inalta performanta ofera cele mai fluide si captivante experiente VR.\r\n\r\n\r\n 	 \r\nResizable BAR\r\n\r\nResizable BAR este o caracteristica avansata a PCI Express, care permite procesorului sa acceseze simultan intregul buffer de cadre din procesorul grafic, imbunatatind performanta in multe jocuri.\r\n\r\n\r\n \r\n', 'No OS', 'Intel® Core i5-12400F', 32, 'ASUS Dual GeForce® RTX™ 4060 Ti OC 8GB GDDR6');
